msg.payload = {
    "O_80_Mag_Full" : false,
    "O_80_Pist_Back" : false,
    "O_80_Pist_Fwd" : false,
    "O_80_Part_Stuck" : false,
    "O_80_Arm_Mag": false,
    "O_80_Arm_Del": false,
    "O_80_Mag_Empty": false,
};

return msg;

let variables = msg.payload;  // Assumindo que msg.payload é um array de variáveis

for (let key in variables) {
 node.send({ topic: key,});  // Envia uma mensagem com a linha atual
    }

return null;  // Finaliza o nó principal (não precisa enviar mais mensagens depois do loop)

let variable = msg.topic;
let value = msg.payload;

msg = {variable: variable};

return msg;

const csv = msg.payload;  // O conteúdo do CSV como string
const variable = msg.variable;  // A variável para buscar

msg.payload = {};

const lines = csv.trim().split('\n');  // Divide o conteúdo em linhas e remove espaços extras
const header = lines.shift().split(';');  // Remove e divide o cabeçalho pelo delimitador ';'

const data = lines.map(line => {
    const [Variable, Namespace, Identifier] = line.split(';').map(value => value.trim());
    return { Variable, Namespace, Identifier };
});

// Debug: log the data and variable to check correctness
// node.warn(`Data: ${JSON.stringify(data)}`);
// node.warn(`Variable: ${variable}`);

function getNamespaceIdentifier(variable) {
    const row = data.find(r => r.Variable === variable);
    if (row) {
        return `${row.Namespace};${row.Identifier}`;
    }
    return null;
}

msg.id = getNamespaceIdentifier(variable);

// Debug: log the result
// node.warn(`Identifier: ${msg.identifier}`);

return msg;

// Create a new payload object
msg.payload = msg.value;
msg.topic = msg.id;

return msg;

